import React from "react";
import { Element } from "react-scroll";

import { Navbar } from "./components/navbar";

const Heading = styled.div`
  align-items-center;
`;

export function Dum(props) {
  return (
      <Element name="dummy">
            <Navbar />
            <Heading><h1>{ props.display }</h1></Heading>

      </Element>

    );
}
